import React, { useState } from 'react'
import { ReadJob } from '../../api'
import { GetDateTime, ReportSort, TableColumbJob } from '../../DataRequest/LogDataRequestWrap';
import moment from 'moment';
import {JobModel } from '../../DataRequest/DataModel';
import { Button, Table } from 'antd';


let LogValue = {
    "LogC3": [],
    "LogG2": [],
}

let ReportList = {
    "C3ReportList": [],
    "G2ReportList": []
}

let JobDetailRecord = {
    datetimeStart: '',
    datetimeEnd: '',
    site: '',
    line: '',
    BufferName: ''
}

let ReportInfoG2 = {}

let BlankPage, ClickTime

const Home = () => {

    const [state, setState] = useState({ count: 0 });


    const RequestJob = async (info, datetimeStart, datetimeEnd, site, line, BufferName) => {
        const response = await ReadJob(info, datetimeStart, datetimeEnd, site, line)
