        ReportList[BufferName] = data
        //console.log(data);
        setState(({ count }) => ({ count: count + 1 }));
    }



    const time = () =>{
        const timetange =  GetDateTime(2,2)
        RequestJob([], timetange[0], timetange[1], 'Polymerlink', 'G2', "G2ReportList")

    }

